import React, { useState } from 'react';
import { Button, Modal } from 'antd';

const AppWorks = () => {
    const [isModalVisible, setIsModalVisible] = useState(false);

    const showModal = () => {
        setIsModalVisible(true);
    };

    const handleOk = () => {
        setIsModalVisible(false);
    };

    const handleCancel = () => {
        setIsModalVisible(false);
    };

    return (

                <>
                    <Button type="primary" onClick={showModal}>
                        Open Modal
                    </Button>
                    <Modal title="Basic Modal" visible={isModalVisible} onOk={handleOk} onCancel={handleCancel} cancelText="Close" closable={false} okButtonProps={{style:{display:'none'}}} cancelButtonProps={{type:'primary'}}>
                        <iframe title='video' width="100%" height="500" src='https://www.youtube.com/embed/DxNu1tVksqM'></iframe>
                    </Modal>
                </>

    );
};

export default AppWorks;
